import React, {
  Dispatch,
  SetStateAction,
  useEffect,
  useRef,
  useState,
} from 'react'
import styled from 'styled-components'
import Select from 'react-select'
import { Ref } from 'react'

const ModalOverlay = styled.div`
  z-index: 1;
  position: fixed;
  top: 0;
  left: 0;
  width: 100vw;
  height: 100vh;
  background-color: rgba(0, 0, 0, 0.5);
  display: flex;
  justify-content: center;
  align-items: center;
`

const ModalWrapper = styled.div`
  position: relative;
  width: 328px;
  height: 192px;
  background-color: #ffffff;
  border-radius: 20px;
`

const Title = styled.text`
font-family: 'Spoqa Han Sans Neo';
font-style: normal;
font-weight: 700;
font-size: 20px;
line - height: 28px;
`

const ModalButtonContainer = styled.div`
  display: flex;
  flex-direction: row;
`
const ModalCloseButton = styled.button`
  top: 10px;
  right: 20px;
  width: 30px;
  height: 30px;
  border-radius: 50%;
  background-color: #ffffff;
  border: none;
  cursor: pointer;
`

interface HistoryModalProps {
  refresh: boolean
  setRefresh: Dispatch<SetStateAction<boolean>>
  onCloseModal: () => void
  text: string
}

export const Modal = (props: HistoryModalProps) => {
  const { refresh, setRefresh, onCloseModal, text } = props

  return (
    <ModalOverlay>
      <ModalWrapper>
        <div style={{ marginTop: '36px' }} />
        <Title>{text}</Title>
        <div style={{ marginTop: '36px' }} />
        <ModalButtonContainer>
          <ModalCloseButton onClick={onCloseModal}>취소</ModalCloseButton>
        </ModalButtonContainer>
      </ModalWrapper>
    </ModalOverlay>
  )
}
